import React from 'react';

interface Props {
    data?: {};
}

const Journals: React.FC<Props> = (props) => {
    const results: any = props.data;
    delete results['uids'];

    console.log(results);
    return (
        <>
            <div>
                {Object.keys(results).map((key) => (
                    <div key={key}>
                        <h3>{results[key].title}</h3>
                        <p>{results[key].pubdate}</p>
                        {results[key].authors.map((el: any) => <p>{el.name}</p>)}
                        <p>{results[key].fulljournalname}</p>
                        <a href={`https://pubmed.ncbi.nlm.nih.gov/${results[key].uid}`}>View journal</a>
                    </div>
                ))}
            </div>
        </>
    );
};

export default Journals;



